import React from "react";
import ChatHome from "./Pages/ChatHome";
import ChatList from "./Components/ChatList/ChatList";
import Grouplist from "./Components/GroupList/GroupList";

const App = () => {
  return (
    <div className="App">
      <ChatHome />
      <ChatList />
      <Grouplist />
    </div>
  );
};

export default App;
